    super();
    this.state = {
      weather: [],
      temp: [],
      clouds: []
    };
  }

  getWeather = query => {
    let url =
      "http://api.openweathermap.org/data/2.5/forecast?q=San+Francisco&appid=0b8748d716f8e438393856aa8448e0ba";

    axios
      .get(url)
      .then(response => {
        console.log(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  };
  render() {
